import React from "react";
// import Mainimage from "../public/image/main.jpg";
const FFheader = () => {

  return (
    <>
    <header>
      <div className="navbar">

          {/* ================ LOGO SECTION ================== */}

          <div className="left1"><span id="blue">FITN</span>NESS</div>
          <div className="logo1"><span id="red">FR</span>EAK</div>
          <div className="logo"><img src="../image/gorilla.png" alt=""/></div>

          {/* ================ NAVBAR SECTION =============== */}

        <ul className="list-parent">
            <li className="item"><a href="/">Home</a></li>
            <li className="item"><a href="/">Contact</a></li>
            <li className="item"><a href="/">About</a></li>
            <li className="item"><a href="/">Services</a></li>
            <li className="item"><button className="login">Login</button></li>
            {/* <li className="menubar">
            <i class="fa-solid fa-bars fa-xl"></i></li> */}
        </ul>
      </div>
    </header>
      {/* ================= MAIN SECTION ================ */}
      
    <section className="main">
      <div className="main-container">
        <img src="../image/main.jpg" alt="" />
        <div className="main-headlines">
          <span className="main-words"><span className="red"></span> WORK HARDER, GET STRONGER </span>
          <h2 className="main-headline">EASY WITH OUR <span className="gym">GYM</span></h2>
          <button className="main-headline-login">BECOME A MEMBER</button>
        </div>
        </div>
        <div className="black"></div>
    </section>


    </>
  );
};

export default FFheader;
